import React from 'react'

import dynamic from 'next/dynamic'
const AppProviderDynamic = dynamic(() =>
  Promise.resolve(require('@shopify/polaris').AppProvider)
)

export default class User extends React.Component {


    render () {
        return (
            <AppProviderDynamic>
                <div>dfd</div>
            </AppProviderDynamic>
        )
    }
}
